package Question.Q859_pass;

import org.junit.Test;

import static org.junit.Assert.*;

public class Solution1Test {

    @Test
    public void buddyStrings1() {
        String A = "ab";
        String B = "ba";

        assertEquals(true, new Solution1().buddyStrings(A, B));
    }

    @Test
    public void buddyStrings2() {
        String A = "ab";
        String B = "ab";

        assertEquals(false, new Solution1().buddyStrings(A, B));
    }

    @Test
    public void buddyStrings3() {
        String A = "aaaaaaabc";
        String B = "aaaaaaacb";

        assertEquals(true, new Solution1().buddyStrings(A, B));
    }

    @Test
    public void buddyStrings4() {
        String A = "";
        String B = "aa";

        assertEquals(false, new Solution1().buddyStrings(A, B));
    }

    @Test
    public void buddyStrings5() {
        String A = "";
        String B = "";

        assertEquals(true, new Solution1().buddyStrings(A, B));
    }
}